load.value:
async () => {
  const data_exist = await db.m_stase.findMany({
    where: {
      id_client: Number(user.id_client),
      t_logbook: {
        some: {
          id_user: user.id,
          m_action: {
            is_milestone: true,
            show_on_milestone: true,
          },
        },
      },
    },
    include: {
      t_logbook: {
        select: {
          id: true,
          id_stase: true,
          m_semester: {
            select: {
              id: true,
              name: true,
              m_stage: {
                select: {
                  label_color: true,
                },
              },
            },
          },
        },
      },
    },
    orderBy: [
      {
        sequence: "asc",
      },
      {
        id_stage: "asc",
      },
    ],
  });

  const data_notexist = await db.m_stase.findMany({
    where: {
      id_client: Number(user.id_client),
      t_logbook: {
        none: {
          id_user: user.id,
          m_action: {
            is_milestone: true,
            show_on_milestone: true,
          },
        },
      },
    },
    include: {
      m_stage: true,
    },
    orderBy: [
      {
        sequence: "desc",
      },
      {
        id_stage: "desc",
      },
    ],
  });

  console.log(data_exist, "halo exist")
  console.log(data_notexist, "halo notexist")

  const data_action = await db.m_action.findMany({
    where: {
      is_milestone: false,
      show_on_milestone: true,
      id_client: Number(user.id_client),
    },
    select: {
      id: true,
      name: true,
      t_logbook: {
        where: {
          id_user: user.id,
          id_client: Number(user.id_client),
          verified: true,
        },
        select: {
          id: true,
          id_action: true,
          m_semester: {
            select: {
              id: true,
              name: true,
              m_stage: {
                select: {
                  label_color: true,
                },
              },
            },
          },
        },
      },
    },
  });

  let merged = [...data_exist, ...data_action];

  let temp_data = [] as any;
  let result = [] as any;

  data_notexist.map((item) => {
    item["x"] = false;
    result.push(item);
  });

  if (merged?.length !== 0) {
    merged?.map((item, id) => {
      // if not having id === action
      if (item.id) {
        item?.t_logbook?.map((item_child, idx) => {
          if (item_child?.m_semester !== null) {
            if (
              temp_data?.find(
                (o) => o?.semester === item_child?.m_semester?.name,
              ) !== undefined
            ) {
              if (
                !temp_data
                  ?.find((x) => x.semester === item_child?.m_semester?.name)
                  ?.child.find((a) => a.name === item?.name)
              ) {
                temp_data
                  ?.find((a) => a?.semester === item_child?.m_semester?.name)
                  ?.child.push({
                    name: item?.name,
                    id_stase: item_child?.id_stase,
                    id_logbook: item_child?.id,
                  });
              }
            } else {
              temp_data?.push({
                id_semester: item_child?.m_semester.id,
                semester: item_child?.m_semester?.name,
                color: item_child?.m_semester?.m_stage?.label_color,
                child: [
                  {
                    name: item?.name,
                    id_stase: item_child?.id_stase,
                    id_logbook: item_child?.id,
                  },
                ],
                action: [],
              });
            }
          }
        });
      } else {
        item?.t_logbook?.map((item_child, idx) => {
          if (item_child?.m_semester !== null) {
            if (
              temp_data?.find(
                (o) => o?.semester === item_child?.m_semester?.name,
              ) !== undefined
            ) {
              if (
                temp_data
                  ?.find((x) => x.semester === item_child?.m_semester?.name)
                  .action.find((a) => a.name === item?.name) !== undefined
              ) {
                temp_data
                  ?.find((x) => x.semester === item_child?.m_semester?.name)
                  .action.find((a) => a.name === item?.name)
                  .count.push(item_child?.id);
              } else {
                temp_data
                  ?.find((a) => a?.semester === item_child?.m_semester?.name)
                  ?.action.push({
                    id_action: item_child.id_action,
                    name: item?.name,
                    count: [item_child?.id],
                  });
              }
            } else {
              temp_data?.push({
                id_semester: item_child?.m_semester.id,
                semester: item_child?.m_semester?.name,
                color: item_child?.m_semester?.m_stage?.label_color,
                child: [],
                action: [
                  {
                    id_action: item_child.id_action,
                    name: item?.name,
                    count: [item_child?.id],
                  },
                ],
              });
            }
          }
        });
      }
    });
  }

  if (temp_data.length !== 0) {
    temp_data.sort((a, b) => a.id_semester - b.id_semester);
    temp_data.map((item, idx) => {
      if (item.semester && item.semester !== undefined) {
        item["id"] = 10000 + Number(idx);
        result.push(item);
      }
    });
  }

  result.reverse();

  return { result };
}

